const formLog=()=> {
  return(
    <>
  <form action="#">
  <input type="password" placeholder="Password" />
  <input type="submit"  value="submit"/>
  </form>
  </>);
}

function App() {
  return (
    <div className="App">
        <p>
         Hello this is my first react application 
         </p>
         <formLog />
    </div>
  );
}

export default App;
